import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TitanEats</h1>
        <Router>
          <Route />
        </Router>
      </header>
    </div>
  );
} 

export default App;
